import styled from 'styled-components';

export const Form = styled.form`
  display: flex;
  align-items: center;
  width: 300px;
  height: 50px;
  border-radius: 5px;
  background-color: #4654e1;
`;

export const Input = styled.input`
  height: 100%;
  width: 100%;
  padding: 0px 10px;
  color: #fff;
`;

export const Button = styled.button`
  display: flex;
  align-items: center;
  width: 50px;
  height: 50px;
  cursor: pointer;
`;

export const Svg = styled.svg`
  width: 24px;
  height: 24px;
  color: #fff;
  fill: currentColor;
`;
